BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "players" (
	"player_id"	INTEGER,
	"name"	TEXT,
	"team"	TEXT,
	"position"	TEXT,
	PRIMARY KEY("player_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "teams" (
	"team_id"	INTEGER,
	"team_name"	TEXT UNIQUE,
	"short_name"	TEXT,
	"strength"	INTEGER,
	"stadium"	TEXT,
	"manager"	TEXT,
	PRIMARY KEY("team_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "player_info" (
	"player_id"	INTEGER UNIQUE,
	"first_name"	TEXT,
	"last_name"	TEXT,
	"position"	INTEGER,
	"team_id"	INTEGER,
	"status"	TEXT,
	"total_points"	INTEGER,
	"current_value"	INTEGER,
	"selected_by_percent"	REAL,
	"news"	TEXT,
	"photo"	TEXT,
	"image_status"	TEXT,
	FOREIGN KEY("team_id") REFERENCES "teams"("team_id"),
	PRIMARY KEY("player_id")
);
CREATE TABLE IF NOT EXISTS "past_performance" (
	"season_id"	INTEGER,
	"player_id"	INTEGER,
	"season_name"	TEXT,
	"total_points"	INTEGER,
	"minutes"	INTEGER,
	"goals_scored"	INTEGER,
	"assists"	INTEGER,
	"clean_sheets"	INTEGER,
	"goals_conceded"	INTEGER,
	"penalties_saved"	INTEGER,
	"penalties_missed"	INTEGER,
	"yellow_cards"	INTEGER,
	"red_cards"	INTEGER,
	"bonus"	INTEGER,
	"bps"	INTEGER,
	"influence"	REAL,
	"creativity"	REAL,
	"threat"	REAL,
	"ict_index"	REAL,
	"own_goals"	INTEGER,
	"saves"	INTEGER,
	UNIQUE("player_id","season_name"),
	FOREIGN KEY("player_id") REFERENCES "players"("player_id"),
	PRIMARY KEY("season_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "recent_performance" (
	"performance_id"	INTEGER,
	"player_id"	INTEGER,
	"gameweek"	INTEGER,
	"total_points"	INTEGER,
	"minutes"	INTEGER,
	"goals_scored"	INTEGER,
	"assists"	INTEGER,
	"bonus"	INTEGER,
	"saves"	INTEGER,
	"yellow_cards"	INTEGER,
	"red_cards"	INTEGER,
	"own_goals"	INTEGER,
	"penalties_missed"	INTEGER,
	"penalties_saved"	INTEGER,
	"opponent_team"	INTEGER,
	"was_home"	INTEGER,
	"clean_sheets"	INTEGER,
	"goals_conceded"	INTEGER,
	"bps"	INTEGER,
	"influence"	REAL,
	"creativity"	REAL,
	"threat"	REAL,
	"ict_index"	REAL,
	"value"	INTEGER,
	"transfers_balance"	INTEGER,
	UNIQUE("player_id","gameweek"),
	FOREIGN KEY("player_id") REFERENCES "players"("player_id"),
	PRIMARY KEY("performance_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "upcoming_fixtures" (
	"fixture_id"	INTEGER,
	"team_id"	INTEGER,
	"opponent_team_id"	INTEGER,
	"gameweek"	INTEGER,
	"is_home"	INTEGER,
	"fixture_date"	TEXT,
	UNIQUE("team_id","opponent_team_id","gameweek"),
	FOREIGN KEY("team_id") REFERENCES "teams"("team_id"),
	FOREIGN KEY("opponent_team_id") REFERENCES "teams"("team_id"),
	PRIMARY KEY("fixture_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "league_standings" (
	"id"	INTEGER,
	"player_id"	INTEGER,
	"league_id"	INTEGER,
	"team_name"	TEXT,
	"player_name"	TEXT,
	"total_points"	INTEGER,
	"rank"	INTEGER,
	"gameweek_points"	INTEGER,
	"previous_rank"	INTEGER,
	"transfers_made"	INTEGER,
	"bank_value"	REAL,
	"team_value"	REAL,
	"chips_used"	TEXT,
	"recent_chip"	TEXT,
	UNIQUE("player_id","league_id") ON CONFLICT REPLACE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "player_gameweek_data" (
	"id"	INTEGER,
	"player_id"	INTEGER,
	"team_name"	TEXT,
	"player_name"	TEXT,
	"gameweek"	INTEGER,
	"points"	INTEGER,
	"rank"	INTEGER,
	"rank_sort"	INTEGER,
	"overall_rank"	INTEGER,
	"transfers_made"	INTEGER,
	"bank_value"	REAL,
	"team_value"	REAL,
	UNIQUE("player_id","gameweek") ON CONFLICT REPLACE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "sentiment_analysis" (
	"mention_id"	INTEGER,
	"player_id"	INTEGER,
	"sentiment_score"	REAL,
	"source"	TEXT,
	"date"	DATE,
	FOREIGN KEY("player_id") REFERENCES "players"("player_id"),
	PRIMARY KEY("mention_id" AUTOINCREMENT)
);
COMMIT;
